import React from "react";

export default function About() {
  return (
    <section className="section about-section">
      <h1 className="section-title">about us</h1>
      <p>
        Drink Type showcases the best available drinks offered by the Platoon.
        It also showcases the name, category, info, glass, instrusctions,
        and ingredients for each type of drink. All drinks are freshly made in house 
        to esnure that our customers are served the best. 

        Our waiters and waitresses are fully knowledgeable about the contents of each 
        freshly made drink, so if you're interested in asking about the ingredients 
        please feel free to ask! 

        </p>
        <p>
        Our Drinks Pack a Punch So Please Drink Responsibly!

      </p>
    </section>
  );
}
